row.EN-Gloss:
used of a group whose members acted or were acted upon collectively and when `all' and `together' can be separated by other words;
    "they were herded all together"; "they were all herded together"; "the books lay all together in a heap"; "the books all lay
    together..."

to a complete degree or to the full or entire extent (`whole' is often used informally for `wholly'); "he was wholly convinced";
    "entirely satisfied with the meal"; "it was completely different from what we expected"; "was completely at fault"; "a totally new situation";
    "the directions were all wrong"; "it was not altogether her fault"; "an altogether new approach"; "a whole new idea"

without any others being included or involved; "was entirely to blame"; "a school devoted entirely to the needs of problem children";
    "he works for Mr. Smith exclusively"; "did it solely for money"; "the burden of proof rests on the prosecution alone"; "a privilege granted only
    to him"
